    public static void processLine(String xmlLine) throws IOException, ParserConfigurationException, SAXException {
        URL url = new URL("https://www.easy-insight.com/app/importActivity");
        //URL url = new URL("http://localhost:8080/app/importActivity");
        HttpURLConnection connection = (HttpURLConnection) url.openConnection();
        connection.setDoOutput(true);
        BASE64Encoder enc = new BASE64Encoder();
        String userpassword = "jboeattention@easy-insight.com" + ":" + "password here";
        String encodedAuthorization = enc.encode(userpassword.getBytes());
        connection.setRequestProperty("Authorization", "Basic " +
                encodedAuthorization);
        OutputStreamWriter out = new OutputStreamWriter(
                connection.getOutputStream());
        out.write(xmlLine);
        out.close();

        BufferedReader in;
        try {
            in = new BufferedReader(
                    new InputStreamReader(
                            connection.getInputStream()));
        } catch (IOException e) {
            in = new BufferedReader(
                    new InputStreamReader(
                            connection.getErrorStream()));
        }

        StringBuilder result = new StringBuilder();

        String line;

        while ((line = in.readLine()) != null) {
            result.append(line);
        }
        in.close();
        DocumentBuilderFactory documentBuilderFactory = DocumentBuilderFactory.newInstance();
        DocumentBuilder documentBuilder = documentBuilderFactory.newDocumentBuilder();
        Document document = documentBuilder.parse(new ByteArrayInputStream(result.toString().getBytes()));
        document.getDocumentElement().normalize();
    }
